import React, { Component } from 'react'

 class Header extends Component {
  render() {
    return (
      <div>
                 <div className="topRedBand">
        <span>
            <div className="logoE">e!</div>
        </span>
        <span>
          
                <input type="button" className="loginButton" value="Login"/>
                <input type="button" className="createAccountButton" value="Create an Account"/>
           
        </span>
    </div>
      </div>
    )
  }
}
export default Header
